/** @format */

import React, { Fragment } from "react";
import SearchIcon from "@mui/icons-material/Search";
import { styled, alpha } from "@mui/material/styles";

import {
  Table,
  TableContainer,
  TableHead,
  TableRow,
  TableCell,
  Checkbox,
  Grid,
  InputBase,
} from "@mui/material";

const MatterDetail = () => {
  const Search = styled("div")(({ theme }) => ({
    position: "relative",
    borderRadius: "1.5rem",
    backgroundColor: "#eee",
    "&:hover": {
      backgroundColor: "#ddd",
    },
    marginRight: theme.spacing(2),
    marginLeft: 0,
    width: "100%",
    [theme.breakpoints.up("sm")]: {
      marginLeft: theme.spacing(3),
      width: "auto",
    },
  }));

  const SearchIconWrapper = styled("div")(({ theme }) => ({
    padding: theme.spacing(0, 2),
    height: "100%",
    position: "absolute",
    pointerEvents: "none",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  }));

  const StyledInputBase = styled(InputBase)(({ theme }) => ({
    color: "inherit",
    "& .MuiInputBase-input": {
      padding: theme.spacing(1, 1, 1, 0),
      // vertical padding + font size from searchIcon
      paddingLeft: `calc(1em + ${theme.spacing(4)})`,
      transition: theme.transitions.create("width"),
      width: "100%",
      [theme.breakpoints.up("md")]: {
        width: "20ch",
      },
    },
  }));

  return (
    <Fragment>
      <Grid container>
        <Grid item xs={12}>
          <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Searchâ€¦"
              inputProps={{ "aria-label": "search" }}
            />
          </Search>
        </Grid>
        <Grid item xs={12}>
          <TableContainer>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>#</TableCell>
                  <TableCell>Recent Document</TableCell>
                  <TableCell>Matter Contact</TableCell>
                  <TableCell>Matter Type</TableCell>
                  <TableCell>Bill Rate</TableCell>
                  <TableCell>Last Action</TableCell>
                  <TableCell>Next Action</TableCell>
                  <TableCell>Assigned to</TableCell>
                  <TableCell>Billable</TableCell>
                  <TableCell>Open Invoice</TableCell>
                  <TableCell>Trust Account</TableCell>
                  <TableCell>Last Payment</TableCell>
                </TableRow>
                {matters?.map((matter) => {
                  <TableRow id={matter.id}>
                    <TableCell>
                      <Checkbox />
                    </TableCell>
                    <TableCell>Matter Tasks</TableCell>
                    <TableCell>Matter Name</TableCell>
                    <TableCell>Matter Contact</TableCell>
                    <TableCell>Matter Type</TableCell>
                    <TableCell>Bill Rate</TableCell>
                    <TableCell>Last Action</TableCell>
                    <TableCell>Next Action</TableCell>
                    <TableCell>Assigned to</TableCell>
                    <TableCell>Billable</TableCell>
                    <TableCell>Open Invoice</TableCell>
                    <TableCell>Trust Account</TableCell>
                    <TableCell>Last Payment</TableCell>
                  </TableRow>;
                })}
              </TableHead>
            </Table>
          </TableContainer>
        </Grid>
      </Grid>
    </Fragment>
  );
};

export default MatterDetail;
